class Medium {
  Medium({
    List<Data>? data,
  }) {
    _data = data;
  }

  Medium.fromJson(dynamic json) {
    if (json['data'] != null) {
      _data = [];
      json['data'].forEach((v) {
        _data?.add(Data.fromJson(v));
      });
    }
  }

  List<Data>? _data;

  Medium copyWith({
    List<Data>? data,
  }) =>
      Medium(
        data: data ?? _data,
      );

  List<Data>? get data => _data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_data != null) {
      map['data'] = _data?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

/// name : "Android App Protect 防破解"
/// html_url : "https://medium.com/@west7418/android-app-protect-%E9%98%B2%E7%A0%B4%E8%A7%A3-f50f30b8eb56"

class Data {
  Data({
    String? name,
    String? htmlUrl,
  }) {
    _name = name;
    _htmlUrl = htmlUrl;
  }

  Data.fromJson(dynamic json) {
    _name = json['name'];
    _htmlUrl = json['html_url'];
  }

  String? _name;
  String? _htmlUrl;

  Data copyWith({
    String? name,
    String? htmlUrl,
  }) =>
      Data(
        name: name ?? _name,
        htmlUrl: htmlUrl ?? _htmlUrl,
      );

  String? get name => _name;

  String? get htmlUrl => _htmlUrl;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['name'] = _name;
    map['html_url'] = _htmlUrl;
    return map;
  }
}
